import axios from 'axios';
import Student from '../../components/Student';
import '../../css/Studentpage.css';
import React, { useEffect, useState } from 'react';
import { AiOutlineSearch } from "react-icons/ai";
<link
  rel="stylesheet"
  href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.3/dist/css/bootstrap.min.css"
  integrity="sha384-rbsA2VBKQhggwzxH7pPCaAqO46MgnOM80zW1RWuH61DGLwZJEdK2Kadq2F9CUG65"
  crossorigin="anonymous"
/>

const Students = () => {
  const [students,setStudents]=useState(null);
  const [cseStudents,setcseStudents]=useState(null);
  const [aiStudents,setaiStudents]=useState(null);
 const [eeeStudents,seteeeStudents]=useState(null);  
 const [ceStudents,setceStudents]=useState(null);
  const [meStudents,setmeStudents]=useState(null);
   const [eceStudents,seteceStudents]=useState(null);

const search = () => {
  }
const [selectedValue, setSelectedValue] = useState('');

const handleDropdownChange = (event) => {
    setSelectedValue(event.target.value);
  };

  useEffect(()=>{
    axios.get('http://localhost:9000/students').then((res)=>{
      setStudents(res.data);
      if(students){
        setcseStudents(students.filter((student) => student.branch === "CSE"));
        setaiStudents(students.filter((student) => student.branch == "AI"));
        setmeStudents(students.filter((student) => student.branch === "MECH"));
        setceStudents(students.filter((student) => student.branch === "CIVIL"));
        seteeeStudents(students.filter((student) => student.branch === "EEE"));
        seteceStudents(students.filter((student) => student.branch === "ECE"));
        console.log(aiStudents);
        console.log(cseStudents)
      }

    }).catch((error)=>{
      console.log(error.message);
    })
  },[setcseStudents,setaiStudents,setmeStudents,seteeeStudents])

  return (
    <div className="stmain">
      <div className="sthead-container">
        <h1 className="stheading1">STUDENTS</h1>

        <form>
          <div className="sform">
            <div className="sname">
              <input type="text" className="name-search" placeholder="name" />
            </div>
            <div className="syear">
              <input type="text" className="year-search" placeholder="year" />
            </div>
            <div className="sbranch">
              <select className="branch-search"
                value={selectedValue}
                onChange={handleDropdownChange}
              >
                <option>CE</option>
                <option>CSE</option>
                <option>CSE AI</option>
                <option>ECE</option>
                <option>EEE</option>
                <option>ME</option>
              </select>
            </div>
            <div className="sicon">
              <AiOutlineSearch onClick={search} size="30px" color="white" />
            </div>
          </div>
        </form>
      </div>

      <div className="stcontent">
      <div className="branch-name">
      {aiStudents && 
        <>
    <h4 className='label'>AI</h4>
    <hr style={{ color:"white", height:"5px" }}/>
    <div className="row row-cols-2">
      {aiStudents.map((student) => (
        <div className="col" >
          <div className='dept-card'>
            <Student student={student} />
          </div>
        </div>
      ))}
  </div>
    </>
}


      {ceStudents && (
      <>
        <h4 className='label'>CIVIL</h4>
        <hr style={{ color:"white", height:"5px" }}/> 
        <div className="row row-cols-2">

            {ceStudents.map((student) => (
              <div className="col">
                <div className='dept-card'>

                <Student student={student} />
                </div>
              </div>
            ))}
          </div>
          </>
        )}
        <h4 className='label'>CSE</h4>
            <hr style={{ color:"white", height:"5px" }}/>
      {cseStudents && (
        <div className="row row-cols-2">

            {cseStudents.map((student) => (
              <div className="col">

                <div className='dept-card'>

                <Student student={student} />
                </div>
              </div>
            ))}
          </div>
        )}
        <h4 className='label'>ECE</h4>
        <hr style={{ color:"white", height:"5px" }}/>
      {eceStudents && (
        <div className="row row-cols-2">

            {eceStudents.map((student) => (
              <div className="col">
                <div className='dept-card'>
                <Student student={student} />
                </div>
              </div>
            ))}
          </div>
        )}
        <h4 className='label'>EEE</h4>
        <hr style={{ color:"white", height:"5px" }}/>
      {eeeStudents && (
        <div className="row row-cols-2">

            {eeeStudents.map((student) => (
              <div className="col">
                <div className='dept-card'>
                <Student student={student} />
                </div>
              </div>
            ))}
          </div>
        )}
        <h4 className='label'>MECH</h4>
        <hr style={{ color:"white", height:"5px" }}/>
      {meStudents && (
        <div className="row row-cols-2">

            {meStudents.map((student) => (
              <div className="col">
                <div className='cse-card'>
                <Student student={student} />
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
      </div>
    </div>
  );
}


export default Students;
